import { useEffect } from 'react';
import { connect, useDispatch } from 'react-redux';
import { withRouter } from 'react-router-dom';

function NameEmail(props) {

  let dispatch = useDispatch();

  const sendInfo = (property, e) => {
    console.log('checking value of e: ', e.target.value);
    dispatch({
      type: 'UPDATE_CUSTOMER',
      payload:
        { [property]: e.target.value }
    });
  }

  const goForward = () => {
    dispatch({
      type: 'QUOTE_PROGRESS',
      payload: { divisor: 7, step_number: 1 }
    });
    props.history.push('./type-of-service');
  }

  const goBack = () => {
    dispatch({
      type: 'QUOTE_PROGRESS',
      payload: { divisor: 7, step_number: 0 }
    });
    props.history.push('/')
  }

  return (
    <div>

      <h2>What is your name and email?</h2>
      <p>We are happy you are interested in a getting a quote!</p>
      <p>So that we know who to call you and so that we can send you the details of your quote what is your email address?</p>


      <br></br>

      <Formik
        initialValues={{ email: '', password: '' }}
        validate={values => {
          const errors = {};
          if (!values.email) {
            errors.email = 'Required';
          } else if (
            !/^[A-Z0-9._%+-]+@[A-Z0-9.-]+\.[A-Z]{2,}$/i.test(values.email)
          ) {
            errors.email = 'Invalid email address';
          }
          return errors;
        }}
        onSubmit={(values, { setSubmitting }) => {
          setTimeout(() => {
            alert(JSON.stringify(values, null, 2));
            setSubmitting(false);
          }, 400);
        }}
      >
        {({
          values,
          errors,
          touched,
          handleChange,
          handleBlur,
          handleSubmit,
          isSubmitting,
          /* and other goodies */
        }) => (
          <form onSubmit={handleSubmit}>
            <input
              type="email"
              name="email"
              onChange={handleChange}
              onBlur={handleBlur}
              value={values.email}
            />
            {errors.email && touched.email && errors.email}
            <input
              type="password"
              name="password"
              onChange={handleChange}
              onBlur={handleBlur}
              value={values.password}
            />
            {errors.password && touched.password && errors.password}
            <button type="submit" disabled={isSubmitting}>
              Submit
            </button>
          </form>
        )}
      </Formik>



      <button onClick={goBack}>Go home</button>
      <button onClick={goForward}>Go to type of service</button>
    </div>
  );
}

export default connect()(withRouter(NameEmail));
